    randomWalkMin = min(randomWalk)
    randomWalkMax = max(randomWalk)

    def __init__(self, incr=1):
        logging.info("Initializing incrementer with value - "+str(incr))
        self.incr = incr

    def setDateObjStart(self,startDate):
        self.dateObjStart = datetime.datetime.strptime(
            startDate + " "+self.factoryStartTime, "%Y-%m-%d %H:%M:%S")

    def retNumBtwRange(self, randomWalkVal, min, max):
        mn = statistics.mean(range(min, max))
        signal = mn * randomWalkVal
        oldMin = mn * self.randomWalkMin
        oldMax = mn * self.randomWalkMax
        return float('{:.4f}'.format((((signal - oldMin) * (max - min)) /
                                      (oldMax - oldMin)) + min))

    def generateData(self):
        returnData = []
        logging.debug("Generate data request - "+str(self.incr))
        if(self.randomWalkIncr >= len(self.randomWalk)):
            self.randomWalkIncr = 0
        randomWalkVal = self.randomWalk[self.randomWalkIncr]
        self.randomWalkIncr += 1
        #math.sin(self.incr)/2 + 1

        # Calculation of counts and packages
        check2GdCnt = math.ceil(self.retNumBtwRange(randomWalkVal, self.sensorDataOthAttrs.get("Check 2-Good Count").get("Min"), self.sensorDataOthAttrs.get("Check 2-Good Count").get("Max")))
        check1GdCnt = math.ceil(self.retNumBtwRange(randomWalkVal, check2GdCnt + 1 , self.sensorDataOthAttrs.get("Check 1-Good Count").get("Max")))
        check1BdCnt = self.sensorDataOthAttrs.get("Check 1-Good Count").get("Max") - check1GdCnt
        check2BdCnt = check1GdCnt - check2GdCnt



        packFlg = 0
        pcsCryFwaded = 0
        pcsUsdFrmCarryFwd = 0
        if check2GdCnt >= self.defaultPiecesInPackage:
            pcsCryFwaded = (check2GdCnt -
                            self.defaultPiecesInPackage)
            self.carryForwardPieces += pcsCryFwaded
            packFlg = 1
        else:
            rmnPcsToPack = self.defaultPiecesInPackage - check2GdCnt
            if self.carryForwardPieces >= rmnPcsToPack:
                self.carryForwardPieces -= rmnPcsToPack
                pcsUsdFrmCarryFwd += rmnPcsToPack
                packFlg = 1
            else:
                pcsCryFwaded = check2GdCnt
                self.carryForwardPieces += pcsCryFwaded
                packFlg = 0
        secToIncr = self.secIncr*30
        dateObj = self.dateObjStart + \
            datetime.timedelta(seconds=secToIncr) + \
            datetime.timedelta(days=self.dayIncr)
        for key in self.sensorDataDefault:
            dynToGenerate = self.dynamicMeasureGenerate.get(key)
            keyProps = self.sensorDataDefault.get(key).copy()
            otherAttrs = self.sensorDataOthAttrs.get(key)
            for indvProp in dynToGenerate:
                if indvProp == "Timestamp":
                    keyProps[indvProp] = dateObj.strftime(
                        "%Y-%m-%d %H:%M:%S")
                elif indvProp == "Mean":
                    keyProps[indvProp] = self.retNumBtwRange(
                        randomWalkVal, otherAttrs.get("Min"), otherAttrs.get("Max"))
                elif indvProp == "Count":
                    if key == "Check 1-Good Count":
                        keyProps[indvProp] = check1GdCnt
                    elif key == "Check 1-Bad Count":
                        keyProps[indvProp] = check1BdCnt
                    elif key == "Check 2-Good Count":
                        keyProps[indvProp] = check2GdCnt
                    elif key == "Check 2-Bad Count":
                        keyProps[indvProp] = check2BdCnt
                    elif key == "Pack-Pack":
                        keyProps[indvProp] = packFlg
                        if packFlg == 1:
                            keyProps["Total Pieces"] = self.defaultPiecesInPackage
                        keyProps["Pieces Carry Forwarded"] = pcsCryFwaded
                        keyProps["Pieces Used from Carry Forwarded"] = pcsUsdFrmCarryFwd
            returnData.append(keyProps)
        self.incr += 1
        if self.secIncr == kafkaEventsPerDay:
            self.dayIncr += 1
            self.secIncr = 1
        else:
            self.secIncr += 1
        logging.debug(returnData)
        # logging.debug("Ch G1 - "+str(check1GdCnt) + " Ch B1 - "+str(check1BdCnt) +
        #              " Ch G2 - "+str(check2GdCnt) + " Ch B2"+str(check2BdCnt) + " Pack Flg - " + str(packFlg) +
        #              " Pieces Carry Forwarded - "+str(pcsCryFwaded) +
        #              " Pieces Used from Carry Forwarded - "+str(pcsUsdFrmCarryFwd))
        return self.dayIncr, returnData


